    Branta canadensis minima)  were marked with individually identifiable neck-bands
    between summer 1982 and summer 1987. Resightings of marked birds during winter were
    used for  estimating the size of the population in autumn and the proportion of
    the  population that used the Klamath Basin (KB) of California. Air and ground  censuses
